import React from 'react';
import classes from './Navbar.module.css';
class Navbar extends React.Component{
    render(){
        return(
            <nav className = {classes.Navbar}>
                <div>toggle</div>
                <div>
                    <div>logo</div>
                    <div>search</div>
                </div>
                <div>notification</div>
            </nav>
        );
    }
}
export default Navbar;
